import React from "react";
import './Quiz.css'
import ActiveQuiz from "../../components/ActiveQuiz/ActiveQuiz";

class Quiz extends React.Component{

    state = {
        quiz: [
            {
                answers:[
                    {text: 'Вопрос 1'},
                    {text: 'Вопрос 2'},
                    {text: 'Вопрос 3'},
                    {text: 'Вопрос 4'}
                ]
            }
        ]
    }

    render() {
        return(
          <div className={'Quiz'}>

              <div className={'QuizWrapper'}>
                  <h1>Quiz</h1>
                  <ActiveQuiz/>
              </div>

          </div>
        )
    }

}
export default Quiz
